const App = () => {

  const [book , setBook] = useState([]);

  const handleClick = (e) => {
    e.preventDefault()
    console.log("clicked -> " , e.target.value)

  }

  return (
    <div>
      <div>
        <input type="text" />
        <button onClick={handleClick} >Click</button>
        <p> {book} </p>
      </div>
    </div>
  )
}

export default App
